import './Cards.css';
import CookieCard from '../CookieCard/CookieCard';
import Loader from '../Components/Loader/Loader';
import axios from 'axios';

import {useState, useEffect} from 'react';

function Cards(props){
    let getCookiesUrl = 'http://localhost:3001/cookie/getAll';

    let [isShowLoader, setShowLoader] = useState(true);
    let [cookies, setCookies] = useState([]);

    useEffect(()=>{
        axios.get(getCookiesUrl, {
            timeout: 5000
        })
        .then((res)=>{
            props.hideLoader();
            setCookies(res.data);
            console.log(res.data);
        })
        .catch((e)=>{
            console.log(e.message);
            setShowLoader(false);
        });
    }, []);

    let cookiesCards = cookies.map((val)=>{
        return(
            <CookieCard />
        );
    });

    return(
        <div className= 'div-cards'>
        </div>
    );
}

export default Cards;
